### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Search Algorithms**
   - **Depth-First Search (DFS)**
     - Explores as far as possible along each branch before backtracking.
     - Uses a stack to keep track of nodes.
   - **Breadth-First Search (BFS)**
     - Explores all neighbors at the present depth before moving on to nodes at the next depth level.
     - Uses a queue to keep track of nodes.
   - **Best-First Search**
     - Uses a priority queue to explore the most promising node first.
     - Often uses a heuristic to determine the priority.
   - **Hill Climbing**
     - A local search algorithm that continuously moves to the best neighboring state.
     - Can get stuck in local optima.

2. **State Space and State Space Graphs**
   - **State Space**: The set of all possible states of a problem.
   - **State Space Graph**: A graph where nodes represent states and edges represent transitions between states.
   - **Reversibility**: A move is reversible if you can return to the previous state.
   - **Reachability**: A state is reachable if there is a path from the start state to the goal state.

3. **Water Jug Problem**
   - **State Representation**: Represented by the amount of water in each jug.
   - **Moves**: Fill a jug, empty a jug, pour water from one jug to another.
   - **State Space Graph**: A graph representing all possible states and transitions.

4. **Traveling Salesman Problem (TSP)**
   - **Nearest Neighbor Heuristic**: Start at a city and repeatedly visit the nearest unvisited city.
   - **Greedy Heuristic**: At each step, choose the best immediate option.
   - **Savings Heuristic**: Calculate savings for combining routes and construct a tour based on these savings.
   - **Partially Mapped Crossover (PMX)**: A genetic algorithm operator used to create offspring from parent tours.

5. **Graph Representation**
   - **Adjacency List**: A collection of unordered lists used to represent a graph.
   - **Path Representation**: A sequence of nodes representing a path through the graph.
   - **Ordinal Representation**: A numerical representation of a path.

6. **Heuristics and Distances**
   - **Manhattan Distance**: The distance between two points measured along axes at right angles.
   - **Heuristic Functions**: Functions used to estimate the cost of the cheapest path from a given state to the goal state.

#### Important Equations

1. **Manhattan Distance**
   \[
   D = |x_1 - x_2| + |y_1 - y_2|
   \]
   where \((x_1, y_1)\) and \((x_2, y_2)\) are the coordinates of two points.

2. **Savings in TSP**
   \[
   S_{ij} = C_{i0} + C_{0j} - C_{ij}
   \]
   where \(C_{i0}\) is the cost from city \(i\) to the depot (fulcrum node), \(C_{0j}\) is the cost from the depot to city \(j\), and \(C_{ij}\) is the cost from city \(i\) to city \(j\).

